import React from 'react'
import { useState,useEffect } from 'react'
import axios from "axios"
function HomeScreen() {

  useEffect(()=>{
    const fetchData=async()=>{
      try{
         const data=(await axios.get('/api/rooms/getallrooms')).data;
         console.log(data);
      }
      catch(error){
         console.log(error);
      }
    }
    fetchData();
},[ ])


  return (
    <>
      <h1>Hello World</h1>
    </>
  )
}

export default HomeScreen
